import React, { useEffect, useState } from 'react';

const SuccessAnimation = ({ darkMode }) => {
  const [animationStage, setAnimationStage] = useState(0);
  
  // Control the animation sequence
  useEffect(() => {
    const stages = [
      { stage: 1, delay: 100 },   // Start folding
      { stage: 2, delay: 800 },   // Continue folding
      { stage: 3, delay: 1500 },  // Complete folding
      { stage: 4, delay: 2200 },  // Envelope closed
      { stage: 5, delay: 2600 },  // Envelope send animation
    ];
    
    // Schedule each animation stage
    stages.forEach(({ stage, delay }) => {
      const timer = setTimeout(() => {
        setAnimationStage(stage);
      }, delay);
      
      return () => clearTimeout(timer);
    });
  }, []);
  
  // The form is always white, so we need to adjust text colors
  const textColorClass = 'text-gray-900';
  const paperColorClass = 'bg-white';
  // Keep consistent lime green branding
  const envelopeColorClass = 'bg-lime-500';
  const envelopeInnerColorClass = 'bg-lime-600';
  
  return (
    <div className="flex flex-col items-center justify-center py-6">
      <div className="relative w-64 h-64 mb-8">
        {/* Envelope container */}
        <div className={`absolute inset-0 ${envelopeColorClass} rounded-md shadow-lg overflow-hidden`}>
          {/* Envelope inner */}
          <div className={`absolute inset-2 ${envelopeInnerColorClass} rounded-sm`}></div>
          
          {/* Envelope flaps */}
          <div 
            className={`absolute top-0 left-0 w-full h-1/2 ${envelopeColorClass} origin-bottom transform ${
              animationStage >= 4 ? 'rotate-0' : 'rotate-180'
            } transition-transform duration-700 ease-in-out z-30`}
            style={{ transformStyle: 'preserve-3d' }}
          ></div>
          
          <div 
            className={`absolute bottom-0 left-0 w-full h-1/4 ${envelopeColorClass} origin-top transform ${
              animationStage >= 3 ? 'rotate-0' : '-rotate-180'
            } transition-transform duration-700 ease-in-out z-20`}
            style={{ transformStyle: 'preserve-3d' }}
          ></div>
          
          <div 
            className={`absolute top-0 left-0 w-1/2 h-full ${envelopeColorClass} origin-right transform ${
              animationStage >= 2 ? 'rotate-0' : '-rotate-90'
            } transition-transform duration-700 ease-in-out z-10`}
            style={{ transformStyle: 'preserve-3d' }}
          ></div>
          
          <div 
            className={`absolute top-0 right-0 w-1/2 h-full ${envelopeColorClass} origin-left transform ${
              animationStage >= 2 ? 'rotate-0' : 'rotate-90'
            } transition-transform duration-700 ease-in-out z-10`}
            style={{ transformStyle: 'preserve-3d' }}
          ></div>
        </div>
        
        {/* Paper/form */}
        <div 
          className={`absolute top-1/2 left-1/2 transform -translate-x-1/2 ${
            animationStage >= 3 ? '-translate-y-1/2 scale-0' : '-translate-y-1/2 scale-100'
          } w-48 h-56 ${paperColorClass} rounded shadow-md transition-all duration-1000 ease-in-out z-0`}
        >
          {/* Simulated form content */}
          <div className="p-4 flex flex-col h-full">
            <div className="w-full h-2 bg-gray-400 rounded-full mb-3"></div>
            <div className="w-3/4 h-2 bg-gray-400 rounded-full mb-6"></div>
            
            <div className="w-full h-2 bg-gray-300 rounded-full mb-2"></div>
            <div className="w-full h-2 bg-gray-300 rounded-full mb-2"></div>
            <div className="w-2/3 h-2 bg-gray-300 rounded-full mb-6"></div>
            
            <div className="w-full h-2 bg-gray-300 rounded-full mb-2"></div>
            <div className="w-full h-2 bg-gray-300 rounded-full mb-2"></div>
            <div className="w-3/4 h-2 bg-gray-300 rounded-full mb-6"></div>
            
            <div className="mt-auto w-1/2 h-4 mx-auto bg-lime-500 rounded-full"></div>
          </div>
        </div>
        
        {/* Flying envelope animation */}
        <div 
          className={`absolute inset-0 transition-all duration-1000 ease-in-out transform ${
            animationStage >= 5 ? 'translate-y-[-150%] translate-x-[100%] rotate-12 scale-75 opacity-0' : 'translate-y-0 translate-x-0 rotate-0 scale-100 opacity-100'
          }`}
        ></div>
      </div>
      
      {/* Success message */}
      <div className={`text-center transition-opacity duration-500 ${
        animationStage >= 5 ? 'opacity-100' : 'opacity-0'
      }`}>
        <h2 className={`text-2xl font-bold ${textColorClass} mb-2`}>
          Thank You For Applying!
        </h2>
        <p className="text-gray-600">
          Your application has been successfully submitted. 
          We'll review your CV and get back to you soon!
        </p>
      </div>
    </div>
  );
};

export default SuccessAnimation;
